eval("module.exports = JSON.parse(\"[{\\\"id\\\":\\\"1\\\",\\\"name\\\":\\\"Busanze Station\\\",\\\"location\\\":\\\"Nyaruguru District\\\",\\\"altitude\\\":\\\"1800-2100m\\\",\\\"annual-rainfall\\\":\\\"1377mm\\\",\\\"processing-method\\\":\\\"Fully Washed\\\",\\\"water-source\\\":\\\"Mountain Natural Spring\\\",\\\"harvest\\\":\\\"\\\",\\\"thumbImage\\\":[\\\"/assets/images/washing-stations/busanze/1.png\\\",\\\"/assets/images/washing-stations/busanze/2.png\\\"],\\\"images\\\":[\\\"/assets/images/washing-stations/busanze/1.png\\\",\\\"/assets/images/washing-stations/busanze/2.png\\\",\\\"/assets/images/washing-stations/busanze/3.png\\\",\\\"/assets/images/washing-stations/busanze/4.png\\\"],\\\"description\\\":\\\"The Busanze Station is a new coffee washing station started in 2018 by Impexcor Coffee and the local farmers of Nyaruguru district. The washing station is located at the edges of Nyungwe forest which allows the nearby coffee trees to grow in the shade of other trees. This gives beans to be rich in density and aroma.\\\\nThe story of the Busanze Station is not only about the quality, but also about the history and patriotism of Nyaruguru people. Usually, Nyaruguru district is known as the home of the most resilient people in the nation. After the genocide against the Tutsi, Nyaruguru became a beacon of unity and reconciliation. Currently, Busanze Station helps create farmer cooperatives for different villages. A good example is the success story of Cooperative Umurego Nteko (KUN) that composed of 82 farmers, mainly young men and women mostly from families from both genocide survivors and perpetrators.\\\\nBusanze Station is 50% owned by the village's farmers cooperative and the other half is owned by the processing company, Impexcor Coffee. This gives the farmer a voice to decide the future of the coffee they produce. This practice creates a sense of ownership that motivates farmers to improve the quality of the coffee.  And it is for that reason that coffee from Busanze has recently won multiple awards including the Alliance Cup of Excellence in 2018.\\\",\\\"slug\\\":\\\"busanze-station\\\"},{\\\"id\\\":\\\"2\\\",\\\"name\\\":\\\"Butambamo Station\\\",\\\"location\\\":\\\"Rusizi District\\\",\\\"altitude\\\":\\\"1500-1700m\\\",\\\"annual-rainfall\\\":\\\"1200-1300mm\\\",\\\"processing-method\\\":\\\"Fully Washed\\\",\\\"water-source\\\":\\\"Mountain Natural Spring\\\",\\\"harvest\\\":\\\"\\\",\\\"thumbImage\\\":[\\\"/assets/images/washing-stations/butambamo/1.png\\\",\\\"/assets/images/washing-stations/butambamo/2.png\\\"],\\\"images\\\":[\\\"/assets/images/washing-stations/butambamo/1.png\\\",\\\"/assets/images/washing-stations/butambamo/2.png\\\",\\\"/assets/images/washing-stations/butambamo/3.png\\\",\\\"/assets/images/washing-stations/butambamo/4.png\\\"],\\\"description\\\":\\\"The Butambamo Station is located in Rusizi District, which is in the Western Province of Rwanda. Farms in the Butambamo area are mostly owned by farmers cooperatives that own the land in the mountains of Nzahaha, a well-known region for fertile sandy loam soil alongside the Rusizi River. During the harvest season in the Butambamo and Nzahaha region, there is heavy rain and a high inclination of soil. The accessibility of the area is very challenging due to the road conditions (mostly muddy). It is for this reason that most of the production at the Butambamo Station is transported by bikes.\\\",\\\"slug\\\":\\\"butambamo-station\\\"},{\\\"id\\\":\\\"3\\\",\\\"name\\\":\\\"Gatare Station\\\",\\\"location\\\":\\\"Nyamasheke District\\\",\\\"altitude\\\":\\\"1542-1857m\\\",\\\"annual-rainfall\\\":\\\"1200-1300mm\\\",\\\"processing-method\\\":[\\\"Fully Washed\\\",\\\"Natural\\\"],\\\"water-source\\\":\\\"Natural Spring\\\",\\\"harvest\\\":\\\"\\\",\\\"thumbImage\\\":[\\\"/assets/images/washing-stations/gatare/1.png\\\",\\\"/assets/images/washing-stations/gatare/2.png\\\"],\\\"images\\\":[\\\"/assets/images/washing-stations/gatare/1.png\\\",\\\"/assets/images/washing-stations/gatare/2.png\\\",\\\"/assets/images/washing-stations/gatare/3.png\\\",\\\"/assets/images/washing-stations/gatare/4.png\\\"],\\\"description\\\":\\\"Within Nyamasheke District, Gatare Station can be found in the localities that surround Kivu Lake, which is a few miles from the Nyungwe Forest. Generally, coffee from Gatare Station comes from the Kivu Belt and the mountains of the Nyungwe Forest edges. Gatare Station is more than a business, they've become a family with 25 permanent employees -- more than 20 of whom have been there for more than a decade. It is for that stability that Gatare Station has been a place where Impexcor Coffee conducts most of its research and trials of the new coffee process. Gatare Station was the first station to produce the natural and honey process. Believe me, we are the best in these processes!\\\",\\\"slug\\\":\\\"gatare-station\\\"},{\\\"id\\\":\\\"4\\\",\\\"name\\\":\\\"Kiyumba Station\\\",\\\"location\\\":\\\"Muhanga District\\\",\\\"altitude\\\":\\\"1840-2400\\\",\\\"annual-rainfall\\\":\\\"1200-1500mm\\\",\\\"processing-method\\\":\\\"Fully Washed\\\",\\\"water-source\\\":\\\"Natural Spring\\\",\\\"harvest\\\":\\\"March through June\\\",\\\"thumbImage\\\":[\\\"/assets/images/washing-stations/kiyumba/1.png\\\",\\\"/assets/images/washing-stations/kiyumba/2.png\\\"],\\\"images\\\":[\\\"/assets/images/washing-stations/kiyumba/1.png\\\",\\\"/assets/images/washing-stations/kiyumba/2.png\\\",\\\"/assets/images/washing-stations/kiyumba/3.png\\\",\\\"/assets/images/washing-stations/kiyumba/4.png\\\"],\\\"description\\\":\\\"Established in 2018 in the Muhanga District near Ndiza Hills, the Kiyumba Station is the newest washing station that we operate. This station was created after realizing that the region did not have a competiting station, but produces the highest quality of coffee. The supply of coffee is mainly from the Kiyumba, Rongi, and Nyabinoni Sectors.  The famers who work these sectors comprise a large cooperative of 1,300 members called COCAM.  This cooperative is composed of 440 women and 860 men.  Together, they are currently growing 566,582 coffee trees on only 342 ha. The processing company, Impexcor Coffee, aims to provide training on the welfare of farmers, on increasing sensitivity to female farmers to hopefully incentivize them joining the cooperatives, and on cultivating the nearby coffee nursery.\\\",\\\"slug\\\":\\\"kiyumba-station\\\"}]\");//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,eyJ2ZXJzaW9uIjozLCJzb3VyY2VzIjpbXSwibmFtZXMiOltdLCJtYXBwaW5ncyI6IiIsImZpbGUiOiIuL3NyYy9kYXRhL3dhc2hpbmctc3RhdGlvbnMuanNvbi5qcyIsInNvdXJjZVJvb3QiOiIifQ==\n//# sourceURL=webpack-internal:///./src/data/washing-stations.json\n");

